import React, { useEffect, useState } from "react";
import axios from "axios";
import PostForm from "./components/postForm";
import CustomLayout from "./components/LayoutTest";

const PostArticle = () => {
  const [articles, setArticles] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:8888/api/member").then((res) => {
      setArticles(res.data);
    });
  }, []);
  return (
    <div>
      <h2 className="QA_navigation">Post Your Article Here</h2>
      <CustomLayout>
        <PostForm requestType="post" articleID={null} btnText="Post it!" />
      </CustomLayout>
    </div>
  );
};

export default PostArticle;
